  const [hideForm, setHideForm] = useState(true);

  const handleForm = () => {
    setHideForm(!hideForm);
  };

  return (
    <div>
      <h1> Hey Admin!</h1>
      <object data="" type=""></object>
      <p> Add a new product: <Link onClick={handleForm}>Show Form</Link></p>
     {!hideForm && <AddProduct />}
    </div>
  );
}

export default Dashboard;
